import React from "react";
import {
  TableRow,
  TableCell,
  Checkbox,
  Typography,
  Button,
  Tooltip,
} from "@material-ui/core";
import CloseIcon from "@material-ui/icons/Close";

export default function TabelTaskItem(props) {
  const onCheck = (e, work) => {
    var check = e.target.checked;
    var workNew = {};
    if (check) {
      console.log("update: " + work);
    } else {
      console.log("rest: " + work);
    }
  };

  return (
    <>
      <TableRow>
        <TableCell>
          <Checkbox
            value={props.checkFinish}
            onChange={(e) => onCheck(e, props.work.work)}
            color="secondary"
          />
        </TableCell>
        <TableCell>
          <Typography
            variant="body1"
            className={props.work.role === "Doing" ? null : "text-through"}
          >
            {props.work.work}
          </Typography>
        </TableCell>
        <TableCell align="right">
          <Tooltip title="Delete" placement="top">
            <Button onClick={() => props.deleteWork(props.work.id)}>
              <CloseIcon color="error" />
            </Button>
          </Tooltip>
        </TableCell>
      </TableRow>
    </>
  );
}
